import { Component, ElementRef, EventEmitter, HostListener, Input, Output, ViewChild } from '@angular/core';
import { FormControl, NgForm, Validators } from '@angular/forms';
import { ActivatedRoute, Router } from '@angular/router';
import { ToastrService } from 'ngx-toastr';
import { Categoria } from 'src/app/models/categoria/categoria';
import { Consulta } from 'src/app/models/consulta/consulta';
import { Paciente } from 'src/app/models/paciente';
import { CategoriaService } from 'src/app/services/service-categoria.service';
import { ServiceConsulta } from 'src/app/services/service-consulta.service';


@Component({
  selector: 'app-cadastrar-consulta',
  templateUrl: './cadastrar-consulta.component.html',
  styleUrls: ['./cadastrar-consulta.component.scss']
})
export class CadastrarConsultaComponent {

  @ViewChild('consultaForm') consultaForm!: NgForm;

  sucessMessage: string = "";

  exibirMensagem: boolean = false;

  consulatId: number = 0;

  consulta: Consulta = {
    idConsulta: 0,
    paciente: 0,
    agendamento: 0,
    dataConsultaAtual: new Date(),
    tipoConsulta: '',
    formaPagamento: '',
  };

  paciente: Paciente = {
    idPaciente: 0,
    cpf: '',
    nomePaciente: '',
    dataNascimentoPaciente: new Date(),
    idadePaciente: 0,
    cidade: '',
    estado: '',
    telefone: ''
  };
  constructor(private serviceConsulta: ServiceConsulta, private rotaAtiva: ActivatedRoute,
    private rota: Router, private el: ElementRef, private toastr: ToastrService) {

  }

  ngOnInit() : void {
    this.rotaAtiva.params.subscribe(params => {
      this.consulatId = +params['id'];
      console.log('ID do Paciente:', this.consulatId);
    })
  }


  addConsulta(form: NgForm): void {
    console.log(this.exibirMensagem)
    console.log(this.consulta.idConsulta)
   if (form.valid) {
      this.serviceConsulta.cadastrarConsulta(this.consulta).subscribe(response =>     
    {
      this.sucessMessage = "Consulta Cadastrado!";
      this.exibirMensagem = true;
      console.log(response);
      console.log(this.consulta);
      console.log(this.exibirMensagem);
      setTimeout(() => {
        this.toastr.success(this.sucessMessage, 'Sucesso');
        this.rota.navigate(['consultas']);
      }, 2000)
    });
    }
    else {
      console.log()
    }
  }

  voltarPagina(): void {
    this.rota.navigate(['consultas'])
  }

@HostListener('input')
onInput() {
  const input = this.el.nativeElement;
  if (input.value < 0) {
    input.value = '';
  }
}
}

<!DOCTYPE html>
<html>
  <head>
    <meta charset="UTF-8">
    <title>HOME</title>
    <link rel="stylesheet" href="./cadastrar-consulta.component.html">
  </head>
  <body>
    <div class="top-bar">
        <header id="bar">
            <div class="logo">
                <img src="/assets/icons/LOGO_JOHW.svg" alt="">

            </div>
            <div class="menu">
                <img id="menu-bento" src="/assets/icons/MENU_BENTO.svg" alt="" onclick="">
                    <section id="menu-bento-aberto">
                        <img src="/src/assets/icons/">
                        <div class="lista-menu">
                            <div class="container text-center">
                                <div class="row row-cols-1 row-cols-sm-2 row-cols-md-4">
                                    <ul class="lista-item">
                                        <!-- <li *ngFor="let item of listMenu">
                                            <a type="button" class="btn btn-primary" onclick="">
                                                <ng-container *ngIf="item.iconSvg">
                                                    <img [src]="item.iconSvg" alt="">
                                                </ng-container>
                                            </a>
                                            <span class="col">{{item.legenda.toUpperCase()}}</span>
                                        </li> -->
                                    </ul>
                            </div>
                        </div>
                        </div>
                    </section>
            </div>
            <div class="user">

            </div>

            <section class="body-consulta">
                <div class="view-consulta">
                    <div class="background-consulta">
                        <form #consultaForm="ngForm" (ngSubmit)="addConsulta(consultaForm)">
                            <legend>
                            <h1>Cadastrar Categoria</h1>
                            </legend>
                            <div class="container text-center" >
                                <div class="row row-cols-2 row-cols-sm-2 row-cols-md-2"> 

                                    <div class="col">
                                        <label for="agenda">Agenda:</label>
                                        <input type="text" id="agenda" name="agenda" [(ngModel)]="consulta.agendamento"
                                        required #agenda="ngModel" autofocus minlength="3" maxlength="50"
                                        [ngClass]="{ 'highlight-error': agenda.invalid && agenda.touched }">
                                        <div class="warning" *ngIf="agenda.invalid && agenda.touched">Campo obrigatório</div>
                                    </div>

                                    <div class="col">
                                        <label for="paciente">Paciente:</label>
                                        <input type="text" id="paciente" name="paciente" [(ngModel)]="consulta.paciente"
                                        required #descricao="ngModel" autofocus minlength="3" maxlength="50"
                                        [ngClass]="{ 'highlight-error': descricao.invalid && descricao.touched }">
                                        <div class="warning" *ngIf="descricao.invalid && descricao.touched">Campo obrigatório</div>
                                    </div>

                                    <div class="col">
                                        <label for="tipoCategoria">Tipo Categoria:</label>
                                        <input type="text" id="tipoCategoria"  name="tipoCategoria" [(ngModel)]="consulta.dataConsultaAtual"
                                        required #tipoCategoria="ngModel" minlength="3" maxlength="50"
                                        [ngClass]="{ 'highlight-error': tipoCategoria.invalid && tipoCategoria.touched }">
                                        <div class="warning" *ngIf="tipoCategoria.invalid && tipoCategoria.touched">Campo obrigatório</div>
                                    </div>

                                    <div class="col">
                                        <label for="descricao">Descrição:</label>
                                        <input type="text" id="descricao" name="descricao" [(ngModel)]="consulta.tipoConsulta"
                                        required #descricao="ngModel" autofocus minlength="3" maxlength="50"
                                        [ngClass]="{ 'highlight-error': descricao.invalid && descricao.touched }">
                                        <div class="warning" *ngIf="descricao.invalid && descricao.touched">Campo obrigatório</div>
                                    </div>

                                    <div class="col">
                                        <label for="descricao">Descrição:</label>
                                        <input type="text" id="descricao" name="descricao" [(ngModel)]="consulta.formaPagamento"
                                        required #descricao="ngModel" autofocus minlength="3" maxlength="50"
                                        [ngClass]="{ 'highlight-error': descricao.invalid && descricao.touched }">
                                        <div class="warning" *ngIf="descricao.invalid && descricao.touched">Campo obrigatório</div>
                                    </div>

                                </div>
                              </div>
                              <div class="button">
                                <input type="submit" class="btn btn-primary" value="Cadastrar">
                                <div *ngIf="exibirMensagem" class="success-message" >
                                    {{sucessMessage}}
                                </div>
                                <input type="button" class="btn btn-primary red" value="Cancelar" (click)="voltarPagina()">
                              </div>

                        </form>
                    </div>
                </div>
            </section>

        </header>
    </div>


    </body>
</html>
